import axios from "axios";
import { ChangeEvent, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { ICategoryCreate } from "../types";

// interface IWoman {
//   name: string,
//   age: number,
//   phone: string
// }

const CategoryCreatePage = () => {

    const navigator = useNavigate();

    const [model, setModel] = useState<ICategoryCreate>({
        name: "",
        description: "",
        file: null
        //base64: ""
    });
    
    const onChangeHandler = (e: ChangeEvent<HTMLInputElement>| ChangeEvent<HTMLTextAreaElement>) => {
        //console.log(e.target.name, e.target.value);
        setModel({...model, [e.target.name]: e.target.value});
    }

    const onFileHandler = (e: ChangeEvent<HTMLInputElement>) => {
        //console.log("Select files: ", e.target.files);
        const {target} = e;
        const {files} = target;
        if(files) {
            const file = files[0];
            setModel({...model, file});
            // const fileReader = new FileReader();
            // fileReader.readAsDataURL(file);
            // fileReader.onload=(readFile) => {
            //     const result = readFile.target?.result as string;
            //     //console.log("Read File", result);
            //     setModel({...model, "base64": result});
            // }
        }
        target.value="";
    }

    const onSubmitHandler = async (e: React.FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        // let woman : IWoman = {
        //   name: "Марина",
        //   age: 48,
        //   phone: "+3897 874 55 44"
        // };
        // console.log("Woman info ", woman);
        // woman = {...woman, age: 34};
        // console.log("Woman new age", woman);
        // woman = {...woman, age: 18, name: "Ілона"};
        // console.log("Woman new age and new name", woman);
        

        try {
            const item = await axios
              .post("http://localhost:8084/api/categories", 
                model, 
                {
                  headers: {
                    "Content-Type": "multipart/form-data"
                  }
                });
            console.log("Server save category", item);
            navigator("/");
        }catch(error: any) {
            console.log("Щось пішло не так", error);
        }
        
    }

  return (
    <>
      <div className="p-8 rounded border border-gray-200">
        <h1 className="font-medium text-3xl">Додати категорію</h1>

        <form onSubmit={onSubmitHandler}>
          <div className="mt-8 grid lg:grid-cols-1 gap-4">
            <div>
              <label
                htmlFor="name"
                className="text-sm text-gray-700 block mb-1 font-medium"
              >
                Назва
              </label>
              <input
                type="text"
                name="name"
                onChange={onChangeHandler}
                value={model.name}
                id="name"
                className="bg-gray-100 border border-gray-200 rounded py-1 px-3 block focus:ring-blue-500 focus:border-blue-500 text-gray-700 w-full"
                placeholder="Вкажіть назву категорії"
              />
            </div>

            <div>
              <label
                htmlFor="description"
                className="block mb-2 text-sm font-medium text-gray-900 dark:text-white"
              >
                Опис
              </label>
              <textarea
                id="description"
                name="description"
                onChange={onChangeHandler}
                value={model.description}
                rows={4}
                className="block p-2.5 w-full text-sm text-gray-900 bg-gray-50 rounded-lg border border-gray-300 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
                placeholder="Вкажіть опис..."
              ></textarea>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700">
                Фото
              </label>

              <div className="mt-1 flex items-center">
                <label
                  htmlFor="selectImage"
                  className="inline-block w-20 overflow-hidden bg-gray-100"
                >
                  {model.file === null ? (
                    <svg
                      className="h-full w-full text-gray-300"
                      fill="currentColor"
                      viewBox="0 0 24 24"
                    >
                      <path d="M24 20.993V24H0v-2.996A14.977 14.977 0 0112.004 15c4.904 0 9.26 2.354 11.996 5.993zM16.002 8.999a4 4 0 11-8 0 4 4 0 018 0z" />
                    </svg>
                  ) : (
                    <img src={URL.createObjectURL(model.file)} />
                  )}
                </label>
                <label
                  htmlFor="selectImage"
                  className="ml-5 rounded-md border border-gray-300 bg-white 
                        py-2 px-3 text-sm font-medium leading-4 text-gray-700 
                        shadow-sm hover:bg-gray-50 focus:outline-none focus:ring-2 
                        focus:ring-indigo-500 focus:ring-offset-2"
                >
                  Обрати фото
                </label>
              </div>

              <input
                type="file"
                id="selectImage"
                onChange={onFileHandler}
                className="hidden"
              />
            </div>
          </div>
          <div className="space-x-4 mt-8">
            <button
              type="submit"
              className="py-2 px-4 bg-blue-500 text-white rounded hover:bg-blue-600 active:bg-blue-700 disabled:opacity-50"
            >
              Додати
            </button>
            <Link
              to="/"
              className="py-2 px-4 bg-white border border-gray-200 text-gray-600 rounded hover:bg-gray-100 active:bg-gray-200 disabled:opacity-50"
            >
              На головну
            </Link>
          </div>
        </form>
      </div>
    </>
  );
};

export default CategoryCreatePage;
